import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import RecipeCard from "./components/RecipeCard/RecipeCard.jsx";
const recipe = {
  id: 234,
  name: "Salmon with roasted vegetables",
  Diets: [
    {
      id: 15,
      name: "Gluten Free",
      Recipe_Diet: {
        RecipeId: 234,
        DietId: 15,
      },
    },
    {
      id: 16,
      name: "Dairy Free",
      Recipe_Diet: {
        RecipeId: 234,
        DietId: 16,
      },
    },
    {
      id: 22,
      name: "Pescetarian",
      Recipe_Diet: {
        RecipeId: 234,
        DietId: 22,
      },
    },
  ],
};
function App() {
  return (
    <div className="App">
      <h1>Henry Food</h1>
      <input type="text" placeholder="Search..." className="search" />
      <RecipeCard props={recipe} />
    </div>
  );
}

export default App;
